import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav>
    <Link className='Nav-Posts' to="/">Posts</Link>
    <Link className='Nav-Posts' to="/create">Create Post</Link>
  </nav>
);

export default Navbar;
